function carouselNormalization() {
  window.heights = [], //create empty array to store height values
    window.tallest; //create variable to make note of the tallest slide
  function normalizeHeights() {
    jQuery('.section-testimonial .carousel-item, .section-hero-slider .carousel-item').each(function () { //add heights to array
      window.heights.push(jQuery(this).outerHeight());
    });
    window.tallest = Math.max.apply(null, window.heights); //cache largest value
    jQuery('.section-testimonial .carousel-item, .section-hero-slider .carousel-item').each(function () {
      jQuery(this).css('min-height', tallest + 'px');
    });
  }
  normalizeHeights();
  jQuery(window).on('resize orientationchange', function () {
    window.tallest = 0, window.heights.length = 0; //reset vars
    jQuery('.section-testimonial .carousel-item, .section-hero-slider .carousel-item').each(function () {
      jQuery(this).css('min-height', '0'); //reset min-height
    });
    normalizeHeights(); //run it again 
  });
}

jQuery(document).ready(function (jQuery) {
  "use strict";
  // For changing body class on scroll
  jQuery(window).on("scroll resize", function () {
    // Default was 250
    if (jQuery(window).scrollTop() >= 250) {
      jQuery(".trans-header").addClass("body-scrolled");
    } else {
      return jQuery(".trans-header").removeClass("body-scrolled");
    }
  });

  // Dropdown toggle 
  jQuery('.dropdown-menu .dropdown-toggle').on('click', function (e) {
    if (!jQuery(this).next().hasClass('show')) {
      jQuery(this).parents('.dropdown-menu').first().find('.show').removeClass('show');
    }
    var $subMenu = jQuery(this).next('.dropdown-menu');
    $subMenu.toggleClass('show');

    jQuery(this).parents('li.nav-item.dropdown.show').on('hidden.bs.dropdown', function (e) {
      jQuery('.dropdown-submenu .show').removeClass('show');
    });

    return false;
  });

  // Soft scroll to anchor on nav links
  if (jQuery('header').hasClass("sticky-top")) {
    var headerHeight = jQuery('header').height();
    var ofset = headerHeight;
  } else {
    var ofset = 0;
  }

  jQuery('.nav-link').on('click', function (event) {
    if (location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') && location.hostname ==
      this.hostname) {
      var target = jQuery(this.hash);
      target = target.length ? target : jQuery('[name=' + this.hash.slice(1) + ']');
      if (target.length) {
        event.preventDefault();
        jQuery('html, body').animate({
          scrollTop: target.offset().top - ofset
        }, 1000, function () {
          var $target = jQuery(target);
          $target.focus();
          if ($target.is(":focus")) {
            return false;
          } else {
            $target.attr('tabindex', '-1');
            $target.focus();
          };
        });
      }
    }
  });

  // Set all carousel items to the same height
  carouselNormalization();
  // Bootstrap Carousel swipe function
  jQuery(".carousel").carousel({
    // interval: false,
    // pause: true
  });
  jQuery(".carousel .carousel-inner").swipe({
    swipeLeft: function (event, direction, distance, duration, fingerCount) {
      this.parent().carousel('next');
    },
    swipeRight: function () {
      this.parent().carousel('prev');
    },
    threshold: 0,
    tap: function (event, target) {
      //window.location = jQuery(this).find('.carousel-item.active a').attr('href');
    },
    excludedElements: "label, button, input, select, textarea, .noSwipe"
  });
  jQuery('.carousel .carousel-inner').on('dragstart', 'a', function () {
    return false;
  });

});

// Arrow on scroll up and down
if (document.getElementById("onTop")) {
  var prevScrollpos = window.pageYOffset;
  window.onscroll = function () {
    var currentScrollPos = window.pageYOffset;
    if (prevScrollpos > currentScrollPos) {
      document.getElementById("onTop").style.cssText = "opacity: 1; visibility: visible";
    } else {
      document.getElementById("onTop").style.cssText = "opacity: 0; visibility: hidden";
    }

    prevScrollpos = currentScrollPos;
    if ((window.innerHeight + window.scrollY) >= document.body.scrollHeight) {
      document.getElementById("onTop").style.cssText = "opacity: 1; visibility: visible";
    }
    if ((window.innerHeight + window.pageYOffset) == window.innerHeight) {
      document.getElementById("onTop").style.cssText = "opacity: 0; visibility: hidden";
    }
  }
}

// Parallax Variant 1
(function () {
  window.addEventListener('scroll', function () {
    var depth, i, layer, layers, len, movement, topDistance, translate3d;
    topDistance = this.pageYOffset;
    layers = document.querySelectorAll("[data-type='parallax']");
    for (i = 0, len = layers.length; i < len; i++) {
      layer = layers[i];
      depth = layer.getAttribute('data-depth');
      movement = (topDistance * depth);
      translate3d = 'translate3d(0, ' + movement + 'px, 0)';
      layer.style['-webkit-transform'] = translate3d;
      layer.style['-moz-transform'] = translate3d;
      layer.style['-ms-transform'] = translate3d;
      layer.style['-o-transform'] = translate3d;
      layer.style.transform = translate3d;
    }
  });
}).call(this);


// Parallax Variant 2
var winScrollTop = 0;
jQuery.fn.is_on_screen = function () {
  var win = jQuery(window);
  var viewport = {
    top: win.scrollTop(),
    left: win.scrollLeft()
  };
  //viewport.right = viewport.left + win.width();
  viewport.bottom = viewport.top + win.height();

  var bounds = this.offset();
  //bounds.right = bounds.left + this.outerWidth();
  bounds.bottom = bounds.top + this.outerHeight();

  return (!(viewport.bottom < bounds.top || viewport.top > bounds.bottom));
};

function parallax() {
  var scrolled = jQuery(window).scrollTop();
  jQuery('.parallax-section').each(function () {

    if (jQuery(this).is_on_screen()) {
      var firstTop = jQuery(this).offset().top;
      var img = jQuery(this).find("img");
      var div = jQuery(this).find(".parralax-content");
      var speed = img.data("speed");
      var divSpeed = div.data("speed");
      var imgMoveTop = (firstTop - winScrollTop) * speed;
      var divMoveTop = (firstTop - winScrollTop) * divSpeed;
      img.css("transform", "translateY(" + -imgMoveTop + "px) translateX(-50%)");
      div.css("transform", "translateY(" + -divMoveTop + "px) translateX(-50%)");
    }

  });
}

jQuery(window).scroll(function (e) {
  winScrollTop = jQuery(this).scrollTop();
  parallax();
});

